import * as React from "react";
import { styled, useTheme } from "@mui/material/styles";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import Grid from "@mui/material/Grid";
import Portrait from "./assets/images/portrait.jpg";
import Logo from "./assets/images/logow.png";

import useMediaQuery from "@mui/material/useMediaQuery";

export default function Home() {
  const theme = useTheme();
  const matches = useMediaQuery(theme.breakpoints.down("sm"));
  //   const coverStyle = {

  //   };

  const coverStyle = styled("div")(({ theme }) => ({
    maxWidth: "100%",
    height: "1440px",
    [theme.breakpoints.up("sm")]: {
      height: "100px",
    },
    backgroundImage: `url(${Portrait})`,
    backgroundSize: "cover",
    position: "center",
  }));

  //   export default function MediaQuery() {
  //     return (
  //       <Root>
  //         <Typography>{'down(sm): red'}</Typography>
  //         <Typography>{'up(md): blue'}</Typography>
  //         <Typography>{'up(lg): green'}</Typography>
  //       </Root>
  //     );
  //   }
  return (
    <>
      <div className="center" style={coverStyle}>
        <Typography
          style={{
            textAlign: "center",
            position: "absolute",
            left: "50%",
            top: "65%",
            transform: "translate(-50%, -50%)",
          }}
          color="white"
          component="div"
        >
          <img src={Logo} alt="profile pic" height="100px" width="100px" />
          <br />
          <br />
          <Typography variant="h6">Connor Created</Typography>
          <br />
          <Typography variant="h5">COMING SOON</Typography>
        </Typography>
      </div>
    </>
  );
}
